@everyone Treatment (from Pulse) for Antony will take a minimum of 4 hours and cost him 500 ED.  Same for Lex, but that doesn't include a replacement arm.  It will take Antony 1 week to make an arm at a cost of 100ED and a DV of 21.  If he fails his roll, he'll have to start again.  

Buying an arm through Finn's connection would cost Lex 500 ED in addition to the treatment cost.  Pulse can install it as well.  

Therapy takes an entire week - no one deciding to to therapy could do a hustle or any other actions.  Pulse will not be available this week to do therapy.
